# https://www.hackerrank.com/challenges/the-minion-game

def minion_game(string):
    VOWELS = "AEIOU"
    stuart_score = 0
    kevin_score = 0

    stuart_test = lambda char: char not in VOWELS
    kevin_test = lambda char: char in VOWELS

    # Stuart, consonants
    stuart_score = scorer(string, stuart_test)

    # Kevin, vowels
    kevin_score = scorer(string, kevin_test)

    if stuart_score > kevin_score:
        print("Stuart", stuart_score)
    elif kevin_score > stuart_score:
        print("Kevin", kevin_score)
    else:
        print("Draw")


def scorer(string, tester):
    score = 0
    # for starting_consonant
    for index, char in enumerate(string):
        if tester(char):
            possible_substring = string[index:]
            # for length
            for length in range(1, len(possible_substring) + 1):
                score += 1
                # print(possible_substring[:length])
    return score


def better_minion(string):
    """Calculate the score of each player based on the length of the string and whether it starts with a vowel or
    consonant.
    From the discussion: https://www.hackerrank.com/challenges/the-minion-game/forum
    """
    VOWELS = "AEIOU"
    stuart_score = 0
    kevin_score = 0

    for i in range(len(string)):
        if string[i] in VOWELS:
            kevin_score += len(string) - i
        else:
            stuart_score += len(string) - i
    if stuart_score > kevin_score:
        print("Stuart", stuart_score)
    elif kevin_score > stuart_score:
        print("Kevin", kevin_score)
    else:
        print("Draw")


if __name__ == '__main__':
    # s = input()
    # s = "BANANA"
    s = ""
    better_minion(s)
